script: |
  super -f text -I q4602.spq | sort > q4602.out

inputs:
  - name: q4602.spq
    data: |
      SELECT DISTINCT - col2 + + col1 / ( - col0 * + 94 + cor0.col1 ) AS col1 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q4602.out
    data: |
      -26
      -27
      -38
